\ul\b AMPLIACION\ulnone\b0\par
\pard\sb100\sa100 Yo ven\'eda circulando por la calle Ag\'fcero (San Miguel) y en la intersecci\'f3n con Bramante comenc\'e9 la maniobra de doblar a la derecha (puse luz de giro) pero no gire, segu\'ed por Ag\'fcero. La moto ven\'eda por Bramante, de mi lado derecho y entiendo que se habr\'e1 confiado por mi luz de giro y por la prioridad de paso y paso. Lo roce y termino impactando contra el cord\'f3n de la esquina. Yo me quede con \'e9l. Vinieron ambulancia del SAME, polic\'eda municipal y polic\'eda bonaerense. Lo atendieron en la ambulancia y \'e9l alego que estaba bien. La moto se abollo en el tanque de combustible y se le rompi\'f3 la pata de apoye y la luz de giro derecha delantera. Debido a eso la dejamos en casa de mis padres (Vigil 2078, San Miguel, a la vuelta de la esquina del hecho) y yo lo acompa\'f1e a su domicilio, luego la paso a retirar con un flete el s\'e1bado siguiente. El choque fue el mi\'e9rcoles  16/1 y la retiro el s\'e1bado 19/1.\par
\pard\par}

