\viewkind4\uc1\pard\cf1\fs20 VH ASEG CIRCULANDO SOBRE CALLE MARCONI,AL GIRAR HACIA INTERSECCION CON GUI\'d1O PUESTO,ES COLISIONADO EN EL LATERAL TRASERO DERECHO  CON LA PARTE DELANTERA DEL TERCERO,QUE CIRCULABA SOBRE GUALEGUAY.(UN OCUPANTE,CON CASCO,NO SE CAE AL PISO,NO INTERVIENE AMBULANCIA NI POLICIA,SE RETIRA POR SUS PROPIOS MEDIOS)\par
