\ul\b AMPLIACION\ulnone\b0\par
Yo circulaba por la Av Marconi desde Palomar hacia la Autopista del Oeste y el transito se detuvo (creo que hubo un problema con un cami\'f3n). Puse el gui\'f1o y gire hacia la derecha  por la calle Gualeguay. Por la derecha ven\'eda una moto pasando los autos detenidos que no llegu\'e9 a ver y \'e9l no lleg\'f3 a frenar. Me choc\'f3 en la puerta trasera del lado del acompa\'f1ante. El joven de la moto, no se cay\'f3, ni se hizo nada, al igual que la moto que qued\'f3 intacta, incluso el joven lamentaba que no pudo frenar (aclaro que yo doble algo r\'e1pido desde que puse el gui\'f1o). El horario fue a las 18:30. \par
Con el conductor de la moto nos pasamos los celulares y tengo audios que confirman que todo estaba bien,  fue un accidente menor y la \'fanica consecuencia del choque es el ray\'f3n en mi puerta trasera. \cf0\par}

