\b\f0\fs20\par
AMPLIACION ASEURADO: \b0 Nos confirma la mec\'e1nica, (\'e9l estaba ingresando al estacionamiento cuando es embestido). Nos amplia que sufri\'f3 lesiones tambi\'e9n.  Respecto de intervenci\'f3n de polic\'eda nos comenta que interviene la comisar\'eda 2da de polvorines. Fue trasladado a la comisar\'eda donde le tomaron declaraci\'f3n, le retuvieron el auto, pero no le realizaron test de alcoholemia por ninguna v\'eda. El same traslad\'f3 al tercero al hospital TRAUMA de Polvorines. Se lo cruz\'f3 al d\'eda siguiente pero no intercambiaron comentarios, s\'f3lo le pidi\'f3 que haga la denuncia en su seguro para poder hacer el reclamo.\f1\fs22\par
\pard\f2\fs20\par}

