AMPLIACION: \b0 Hablo el asegurado me informa que el circulaba derecho por la colectora de camino se cintura cuando un motociclista se cierra y lo embiste en el lateral. El motociclista no llego a caer al piso, se levanto y retiro por sus propios medio. En el momento no intervino ambulancia ni polic\'eda. \par
\pard\sa200 El tercero le pas\'f3 solo nombre, DNI y le manifest\'f3 que no ten\'eda seguro.\f1\fs22\par
\pard\f2\fs20\par}

