\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Circulando por Av. Juan B Justo, a la altura aproximada del 2200, dentro del carril derecho, cuando por haber un auto estacionado en la puerta de un taller, debo frenar, ya que por el carril izquierdo circulaba un cami\'f3n, momento en que siento un impacto desde atr\'e1s, soy embestido por una moto que quer\'eda pasar por mi izquierda y por el lado derecho del cami\'f3n. Me impacta en paragolpes trasero y lateral izquierdo- el de la moto iba solo, no recuerdo si ten\'eda casco puesto- no observe lesiones mayores, solo raspones en codo izquierdo por roce con el cami\'f3n.- el cami\'f3n para adelante, luego de querer pedirle datos se retira del lugar- no vi si se cay\'f3 al suelo o no- no hubo m\'e1s involucrados- no intervino ni polic\'eda ni ambulancia- intercambiamos datos y se retira del lugar- cel 115455-4185\par
\pard\b AMPLIACION ASEGURADO: \cf1\b0 Asegurado frena porque delante del queda un veh\'edculo frenado, y una motocicleta lo impacta desde atr\'e1s. El motociclista no cayo le dice que un tercer cami\'f3n lo encerr\'f3 y por eso lo tiro contra el veh\'edculo. \par
No intervino ambulancia ni polic\'eda.\par
\pard\sa200 El asegurado quiere reclamar en la compa\'f1\'eda del tercero.\cf0\b\par
\pard\sa160\sl252\slmult1 MECANICA DEL HECHO SEGUN TERCERO: \b0 Denuncia "Siendo el d\'eda 31-01-2020 a las 15.15hs aproximadamente. Circulando por Av. Juan B Justo  en la localidad de CABA sentido hacia calle Aguirre en su doble mano, realizo maniobras para sobre pasar un cami\'f3n  y es ah\'ed cuando un tercero, veh\'edculo Fiat Siena que circulaba a la par realiza una mala maniobra por estar en discusi\'f3n con el cami\'f3n  no percata mi presencia impactando con su lateral delantero izquierdo mi lateral derecho expuls\'e1ndome hacia el cami\'f3n es ah\'ed donde me caigo al asfalto, me levanto por mis propios medios, sin manifestar lesiones, si dolencias, intercambiamos datos."\par
\pard\sa200\par
\pard\f1\par}

