\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION TERCERO: Denuncia \b0\f2 "Circulando por el primer carril de mano izquierda de Av. C\'f3rdoba, al llegar a la intersecci\'f3n con la calle Medrano el auto patente DCQ003 gira imprevistamente a la izquierda invadiendo mi carril. No tuve tiempo de frenar por lo que impacto en el v\'e9rtice trasero izquierdo del veh\'edculo, ya a baja velocidad, provocando mi ca\'edda sobre el pavimento y da\'f1os mec\'e1nicos y est\'e9tico a la moto."\f1\fs22\par
