\pard AMPLIACION: \b0 Hablo con la asegurada me informa que circulaba por la calle Mercedes y al girar en Simbro una moto que circulaba por la misma calle misma direcci\'f3n intenta sobrepasarla por el lateral y la embiste. Tanto el motociclista como su acompa\'f1ante cayeron, se levantaron y se retiraron sin dejar m\'e1s datos que los que pas\'f3 en la denuncia. \par
\pard\sa200 No sabe si ten\'edan seguro y no tiene datos de la moto.\f1\fs22\par
