\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Circulaba por ruta Panamericana maniobro para la derecha y freno ya que se me cruzo un veh\'edculo -siendo embestido por una moto de atr\'e1s- a paragolpes- ba\'fal y lateral trasero izquierdo- el motociclista cae, se levanta por sus medios rengueando-llevaba casco-interviene polic\'eda y ambulancia desconozco si lo trasladan ya que me retiro previamente cuando me verifican datos y documentaci\'f3n personal la polic\'eda y autopista.\b\par
\pard AMPLIACION: \b0 Llamo al asegurado, me informa que no le realizaron control de alcoholemia y que desconoce si trasladaron al tercero, pero si lo vio levantarse por sus propios medios. No llego a tomar ning\'fan tel\'e9fono salvo los datos que saco del registro al cual le tomo foto. \par
\pard\sa200\sl360\slmult1 A\'fan no sabe si va a reclamar en la compa\'f1\'eda del tercero. \b\par
\pard\sa160\sl252\slmult1 MECANICA DEL HECHO SEGUN TERCERO: Denuncia \b0 "Asegurado circulaba por Panamericana cuando un veh\'edculo frente a \'e9l por una mala maniobra hace un trompo, el asegurado no tiene otra opci\'f3n y lo impacta en el lateral trasero izquierdo."\par
\pard\f1\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Circulando por Av. Santa Mar\'eda gire hacia la izquierda para tomar Venezuela y una moto que circula en mi misma direcci\'f3n me choca en la parte trasera izquierda de mi autom\'f3vil. Un solo ocupante en la moto, cay\'f3 al piso. Ten\'eda casco colocado. No intervino ambulancia ni polic\'eda. Se retir\'f3 en la moto por sus propios medios.\par
\b\par
\pard MECANICA DEL HECHO SEGUN TERCERO: \b0 Hablo con  la tercera me informa que ella circulaba detr\'e1s del asegurado, el asegurado se abre hacia a derecha y luego gira bruscamente para la izquierda y es ah\'ed cuando el asegurado la encierra y se genera el impacto. \par
\pard\sa160 No tiene certificados m\'e9dicos pero si quiere reclamar los da\'f1os de su moto.\par
\pard\f1\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\f0\fs22 SIENDO  LA HORA INDICADA  COLICIONO  CON UNA MOTO EL CUAL NOS DETENIAMOS EN UN SEMAFORO.AL MOMENTO DE FRENAR SE ACTIVA EL SENSOR DE ABS DEJANDO EL PEDAL ARRIBA Y SE FRENA CON EL DE ANO.\par
UNA VEZ COLICIONADO SE PROCEDE A LA AYUDA DEL  TERCERO Y AGUARDANDO LA AMBUANCIA YA QUE EL MISMO ADUCIA UN DOLOR EN EL CODO\par
\f1\fs20\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fswiss\fprq2\fcharset0 Calibri;}{\f2\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Asegurado circulaba por calle Jujuy, al cruzar calle Indart, fue embestido en lateral trasero derecho por un tercero (moto) que ven\'eda por la \'faltima mencionada. Un ocupante en la moto, no recuerda si llevaba casco colocado, se cay\'f3 al asfalto, sin desplazamientos. No intervino polic\'eda ni ambulancia.-\b\par
\pard\sa160\sl252\slmult1 MECANICA DEL HECHO SEGUN TERCERO: Denuncia \b0 "Circulaba por Indart hacia San Justo, se me cruzo un Peugeot 206. Intente frenar pero no fue suficiente para evitar el impacto. Lo termine colisionando con mi parte delantera sobre la puerta trasera derecha. El Peugeot venia por Jujuy a velocidad excesiva."\f1\fs22\par
\pard\f2\fs20\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\fswiss\fprq2\fcharset0 Arial;}{\f2\fnil\fcharset0 Arial;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\f0\fs22 VEHICULO ASEGURADO CIRCULANDO POR ALVEAR, EN EL MOMENTO QUE SE DISPONE A GIRAR A LA DERECHA HACIA LACROZE, SE PRODUCE LA COLISION CON UNA MOTO QUE CIRCULABA POR SU LADO DERECHO. EN LA MOTO CIRCULABA UNA SOLA PERSONA. MOTO CAE AL PISO. CONDUCTOR NO. UTILIZABA CASCO. NO INTERVIENE POLICIA. NO INTERVIENE AMBULANCIA. LUEGO EL CONDUCTOR DE LA MOTO SE RETIRA POR SUS PROPIOS MEDIOS.\par
\par
\cf1\fs24\par
\b AMPLIACION ASEGURADO\b0\par
\f1\fs20 19:50 hs en Villa Ballester calle Alvear, doble a la derecha, y sent\'ed que una moto se cae al lado de mi auto, Seg\'fan el conductor de la moto lo encerr\'e9 y doble sin se\'f1alizaci\'f3n (yo creo que si hab\'eda puesto el gui\'f1o), Aclaro que no llegue a tocar la moto y si la toque no tengo ning\'fan signo visible en el auto. Aclaro que al conductor nunca lo vi ca\'eddo. Seg\'fan el conductor de la moto se le rompi\'f3 el volante(manubrio, o como se llame)\f0\fs24\par
 \par
\f1\fs20 NINGUNA COMISARIA INTERVINO ,  NO HUBO LESIONES, Se subi\'f3 a la moto y se fue con el volante roto (segun el) despu\'e9s de dejarnos los datos para hacer la denuncia en nuestros respectivos seguros. Lo cual comento que el no sabia si la iba hacer.\f0\fs24\par
\cf0\f2\fs20\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Venia circulando por Av Sarmiento (sentido Plaza Italia) por el carril izquierdo. Al ver que no ven\'eda nadie para cambiarme al carril derecho, es alli que cuando hago la maniobra, de repente una moto a alta velocidad me colisiona en la parte trasera derecha de mi veh\'edculo con su manillar izquierdo cae la moto junto al conductor quedando en el suelo hasta que llega 10\'b4 m\'e1s tarde llega el SAME y lo trasladan al Hospital Rivadavia. Me acerco al hospital por mis propios medios, me quedo con el hasta que lo atienden en la guardia. Sigo en contacto telef\'f3nicamente con \'e9l y me informa que ya le dieron el alta e hizo su denuncia por ART. Intervino polic\'eda y SAME. \b\par
\pard MECANICA DEL HECHO SEGUN TERCERO: Denuncia "En el d\'eda 4/3 a las 8.00 transitando por Av. Sarmiento a la altura de La Rural, yendo por la senda izquierda, intente sobrepasar un auto por el carril derecho, el cual doblo al mismo tiempo, toco mi rueda delantera a la altura de los barrales del lado izquierdo, el auto fue golpeado encima de la luz de giro, lado derecho. La moto cay\'f3 sobre el lado izquierdo, rompiendo as\'ed la luz de giro, el pie de apoyo del acompa\'f1ante y generando ralladuras."\b0\f1\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Circulando por Rosella al estar cruzando 1\'b0 De Mayo fui chocado en mi parte delantera derecha y lateral derecho por una moto. En la moto iba una sola persona menor de edad (17 seg\'fan sus dichos) sin casco y en ojotas. El conductor cae al piso con lesiones en un pie/tobillo. Se retir\'f3 con su madre (viven a la vuelta) quien lo llevo al Hospital Bocalandro intervino com 11\'b0-  3 De Febrero.\par
\b\par
\pard AMPLIACION: \b0 informa que en la intersecci\'f3n no hay se\'f1alizaci\'f3n ni sem\'e1foro. El circulaba por Rosella y al empezar a cruzar la calle 1 de Mayo es embestido en su lateral delantero derecho por un motociclista. El motociclista cayo, como vive por el barrio inmediatamente personas que pasaban por ah\'ed le avisaron a la madre y lo vino a buscar. Si bien el asegurado ya hab\'eda llamado a la ambulancia y polic\'eda, la madre del tercero se lo quiso llevar ella al hospital.\par
No tiene datos del tercero porque al llegar la polic\'eda, que NO le realizo control de alcoholemia, le pidieron los datos y le dijeron que se retire qued\'e1ndose ellos con el padre del tercero, que llego minutos m\'e1s tardes. \par
El asegurado informa que al d\'eda siguiente el tercero junto a su padre fueron a su domicilio a pedirles dinero, \'e9l se neg\'f3 y le paso los datos del seguro, pero no le quisieron dejar a \'e9l ning\'fan dato\f1\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fswiss\fprq2\fcharset0 Segoe UI;}{\f2\fswiss\fprq2\fcharset0 Calibri;}{\f3\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\b\f0\fs20 MECANICA DEL HECHO SEGUN  VERSION ASEGURADO: \b0\f1 Venia circulando por Av Olazabal y a la altura de 3600 activo las balizas para guardar mi vehiculo en mi garage particular mano izquierda. Disminuyendo la velocidad observo que no venia nadie. Cuando giro 90\'b0 hacia la izquierda para ingresarlo a la cochera, de repente una moto impactasu parte delantera con la parte izquierda y delantera de mi vehiculo. El motociclista cae al suelo. Consulto por su estado de salud se encontraba bien. Es ahi que llamo a emergencias. A los pocos minutos, llega una ambulancia y lo trasladan al Hospital Pirovano. Posteriormente segui en contacto telefonico con el, me informa que tuvo unos raspones y que le cosieron una herida en una pierna (consecuencia de haberse caido la moto encima) no intervino policia\f2\fs22\par
\f3\fs20\par}

