\viewkind4\uc1\pard\f0\fs22 VH ASEGURADO SE ENCONTRABA SALIENDO DEL GARAGE DE SU DOMICILIO SOBRE AVENIDA LUIS MARIA CAMPOS. VH TERCERO, MOTO, VEN\'cdA POR LA MISMA AVENIDA. CUANDO EL ASEGURADO SALE, TEN\'cdA LA VISTA TAPADA POR UN CAMI\'d3N DE BEBIDAS, NO LOGRA VER A LA MOTO. LA MOTO TAMPOCO VE AL ASEGURADO Y TERMINA IMPACTANDO CON SU PARTE DELANTERA, EN EL LATERAL IZQUIERDO DEL ASEGURADO. PRODUCTO DEL CHOQUE, MOTO Y OCUPANTE CAEN AL PISO. UN SOLO OCUPANTE EN LA MOTO, CON CASCO. PRESENTA UN RASP\'d3N EN UN DEDO DE LA MANO DERECHA Y TAMBI\'c9N ESTABA HINCHADA. CON INTERVENCI\'d3N DE POLICIA EN EL LUGAR. SIN INTERVENCI\'d3N DE AMBULANCIA, YA QUE LA POLICIA CONSTATO QUE NO ERA NECESARIO. EL TERCERO SE RETIRA DEL LUGAR, SIN ANDAR EN LA MOTO. SIN DESPLAZAMIENTO. \par
\f1\fs20\par}

