\viewkind4\uc1\pard\ltrpar\f0\fs22 VH ASEGURADO SE ENCONTRABA CIRCULANDO POR CALLE PER\'da. VH TERCERO, MOTO, VEN\'cdA POR CALLE NUESTRA SE\'d1ORA DE LA MERCED. EL ASEGURADO ANTES DE CRUZAR MIRA A AMBOS LADOS, DEJA PASAR 2 VH QUE VEN\'cdAN POR LA MERCED, CUANDO ACELERA PARA INTENTAR CRUZAR, LA MOTO QUE VEN\'cdA A GRAN VELOCIDAD DE SU MANO IZQUIERDA, IMPACTA CON SU PARTE DELANTERA, EN EL LATERAL IZQUIERDO DELANTERO DEL ASEGURADO. PRODUCTO DEL CHOQUE, MOTO Y OCUPANTE CAEN AL PISO. UN SOLO OCUPANTE EN LA MOTO, CON CASCO. CON INTERVENCI\'d3N DE POLIC\'cdA Y DE AMBULANCIA EN EL LUGAR, QUIEN TRASLADA AL TERCERO AL HOSPITAL CARRILLO Y DE AH\'cd LO LLEVAN AL BOCALANDRO. EL TERCERO SUFRI\'d3 UN ESGUINCE EN EL HOMBRO DERECHO. SIN DESPLAZAMIENTO. \par
