\viewkind4\uc1\pard\sa160\sl252\slmult1\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0\f1 Asegurado circulando sobre Curapaligue en intersecci\'f3n con Lezama , un tercero circulando por la ultima en moto cae al piso sin contacto con el cliente. El asegurado lo ayud\'f3 a incorporarse, dolencia en tobillo. No acepto asistencia, se retir\'f3 andando en la moto- Luego es contactado por del padre del 3ro pidiendo indemnizaci\'f3n por los gastos m\'e9dicos.\f2\fs22\par
\pard\b\f0\fs20 AMPLIACION: \b0\f1 Hablo con el asegurado me dice que circulaba por la calle Carapaligue, al llegar a la intersecci\'f3n frena y una moto que ven\'eda desde su izquierda a mucha velocidad intenta esquivarlo y sin tocarlo cae al piso y desliza. El asegurado baja le consulta si se encontraba bien, el tercero le dice que si, se pasan los datos y se retira andando en la motocicleta\par
No intervino policia ni ambulancia.-\f2\fs22\par
\f1\fs20\par}

{\rtf1\fbidis\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\ltrpar\f0\fs22 VH ASEG. CIRCULANDO SOBRE RUTA 8 POR NO COLISIONAR A UN VH QUE REALIZA UNA MALA MANIOBRA Y FRENA EN MEDIO DE LA RUTA EL VH ASEG. PIERDE EL CONTROL DEL VH ES COLISIONADO POR UN TERCERO (MOTO EL CUAL CIRCULABA MANO CONTRARIA AL ASEG. QUE LUEGO CAE A UN ZANJA) EL CONTACTO DE LA MOTO FUE CON LA PARTE DELANTERA DEL MISMO EN LA PARTE LATERAL DERECHA DEL VH ASEG. EN LA MOTO HABIA DOS OCUPANTES SIN CASCO PUESTO APARENTEMENTE, LOS CUALES CAEN A LA ZANJA, PRESENTA FRACTURAS EN LA PIERNA, INTERVINO MOVIL POLICIAL Y AMBULANCIA LA CUAL TRASLADA A LOS TERCERO Y AL ASEG. EL HOSPITAL TRAUMA DE NOGUES Y A UNO DE LOS TERCERO SE DESCONOCE DONDE FUE TRASLADADO, VH ASEG. ESTA EN DEPOSITO POLICIAL POR PERITAJES, EL CUAL YA ESTA DADO DE ALTA, NO SE REALIZO ALCOHOLEMIA.\par
SIN DESPLAZAMIENTOS.\par
\pard\ltrpar\f1\fs20\par}

